import { ReactComponent as LogoImage } from "../../assets/images/header/Logo.svg";
import { ReactComponent as BasketImage } from "../../assets/images/header/basket.svg";
import { ReactComponent as PhoneImage } from "../../assets/images/header/phone.svg";
import { ReactComponent as BurgerButtonImage } from "../../assets/images/header/burgerButton.svg";

import "../../styles/headerStyled.scss";

export default function Header() {
  const data = {
    logoText: {
      text: "LISTVA",
      url: "#"
    },
    logoSubtitle: {
      text: "Служба доставки квітів",
      url: "#"
    },
    phoneNumber: {
      text: "+38 (068) 999 99 99",
      url: "tel:0689999999"
    },
    languageLinks: [
      { text: "UA", url: "#" },
      { text: "EN", url: "#" }
    ],
    navLinks: [
      { text: "Каталог", url: "#" },
      { text: "Переваги", url: "#" },
      { text: "Відгуки", url: "#" },
      { text: "Контакти", url: "#" }
    ],
    currency: {
      text: "UAH",
      url: "#"
    },
    basket: {
      url: "#"
    }
  };
  return (
    <header className="header">
      <div className="header__container">
        <div className="header__logo-container">
          <a href={data.logoText.url} className="header__logo-link">
            <LogoImage className="header__logo" />
          </a>
          <div className="header__logo-text">
            <span className="header__title">{data.logoText.text}</span>
            <span className="header__subtitle">{data.logoSubtitle.text}</span>
          </div>
        </div>
        <div className="header__contact">
          <div className="header__phone-container">
            <PhoneImage className="header__phone" />
            <a href={data.phoneNumber.url} className="header__phone-text">{data.phoneNumber.text}</a>
          </div>
          <p className="header__languages">
            {data.languageLinks.map((link, index) => (
              <React.Fragment key={index}>
                <a href={link.url} className="header__language-link">{link.text}</a>
                {index !== data.languageLinks.length - 1 && <span>|</span>}
              </React.Fragment>
            ))}
          </p>
        </div>
      </div>
      <div className="header__navigation">
        <nav>
          <ul className="header__nav-list">
            {data.navLinks.map((link, index) => (
              <li key={index} className="header__nav-item">
                <a href={link.url} className="header__nav-link">{link.text}</a>
              </li>
            ))}
          </ul>
        </nav>
        <div className="header__currency">
          <p className="header__currency-text">{data.currency.text}</p>
          <a href={data.basket.url} className="header__basket-link">
            <BasketImage className="header__basket" />
          </a>
        </div>
      </div>
      <BurgerButtonImage className="header__burger-button" />
    </header>
  );
};
